import ValueChanger from "./ValueChanger";
import Grid from '@mui/material/Unstable_Grid2'; // Grid version 2
import Stack from '@mui/material/Stack';
import React, { useState } from 'react';
import Select from '@mui/material/Select';
import MenuItem from '@mui/material/MenuItem';
import { Menu } from "@mui/material";
function CollapsibleChanger(props){

    const [currentIndex, setCurrentIndex] = useState(1);
    //let valueChangerList = [];
    let items = [];

    const sendChange = (newValue) => {
        // console.log(currentIndex);
        // console.log(props.property);
        // console.log(newValue);
        // let x = new Object;
        // x[currentIndex] = new Object();
        // x[currentIndex][newValue[0]] = newValue[1];
        // console.log(x);
        console.log(newValue)
        props.onValueChange(newValue)
    }
    console.log(props.value);
    for(const [itemNumber, itemValue] of Object.entries(props.value)){
        items.push(
            <MenuItem key={itemNumber} value={itemNumber}>
                {itemNumber}
            </MenuItem>
        )
    }
    console.log(items);
    let ta = [];
    for(const [property, value] of Object.entries(props.value[1])){//Change the one to set to the first element. //MAKE THIS A DROP DOWN TO SELECT WHICH PROPERTIES
        console.log(value);
        ta.push(
            <ValueChanger sx={{}} key={property} property={property} value={value} keyHistory={[...props.keyHistory, props.property, currentIndex]} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
        )
    
    }
    const [valueChangerList, setValueChangerList] = useState(ta);    

    return(
        
        <Stack spacing={0} sx={{pl: 0,}}>
            <Select value={currentIndex} onClick={() => {setCurrentIndex(2)}}>
                {items}
            </Select>
            {valueChangerList}
        </Stack>

    )
}

export default CollapsibleChanger;
